package cn.dogplanet.entity;public class WXPayEntity extends Resp {	private WXPay result;	public WXPay getResult() {		return result;	}	public void setResult(WXPay result) {		this.result = result;	}	public class WXPay {		private String appid;		private String partnerid;		private String noncestr;		private String timestamp;		private String prepayid;		private String sign;		public String getAppid() {			return appid;		}		public void setAppid(String appid) {			this.appid = appid;		}		public String getPartnerid() {			return partnerid;		}		public void setPartnerid(String partnerid) {			this.partnerid = partnerid;		}		public String getNoncestr() {			return noncestr;		}		public void setNoncestr(String noncestr) {			this.noncestr = noncestr;		}		public String getTimestamp() {			return timestamp;		}		public void setTimestamp(String timestamp) {			this.timestamp = timestamp;		}		public String getPrepayid() {			return prepayid;		}		public void setPrepayid(String prepayid) {			this.prepayid = prepayid;		}		public String getSign() {			return sign;		}		public void setSign(String sign) {			this.sign = sign;		}		@Override		public String toString() {			return "WXPay [appid=" + appid + ", partnerid=" + partnerid					+ ", noncestr=" + noncestr + ", timestamp=" + timestamp					+ ", prepayid=" + prepayid + ", sign=" + sign + "]";		}	}}